function timeConvert(n) {
	const num = Number(n);
	var str = "";
	var hours =0;
	var rhours =0;
	var minutes =0;
	var rminutes =0;
	var seconds = 0;
	var rseconds = 0;
	if(num > 3600)
	{
		var nn = (num / 3600);
		var rn = Math.floor(nn);
		hours = (n - rn) * 3600;
		hours = (hours / 60);
		rhours = Math.floor(hours);
		minutes = (hours - rhours) * 60;
		rminutes = Math.round(minutes);

		seconds = (minutes - rminutes)*60;
		rseconds = Math.round(seconds);

		str = rhours + " hours & " + rminutes + " minutes & " + " " + rseconds + " seconds";
	}
	else
	if(num > 60)
	{
		minutes = (num / 60);
		rminutes = Math.floor(minutes);
		seconds = (minutes - rminutes)*60;
		rseconds = Math.round(seconds);

		str = rminutes + " minutes & " + rseconds + " seconds";
	}
	else
	{
		str = num + " seconds";
	}
	return str;
}

