                validate_js = JSON.parse(vtext);
            }
            catch(e) {
                search_term = "";
                SZ += 1;
            }
        }
        else
        {
            search_term = arr[0];
        }

        js += search_term
        counter +=1;
    }

    js = js.substring(0, js.length-1);
    js += ']}';

    var partB = js;
    js = partA + partB;

    return JSON.parse(js);
}

